import React from 'react'
import './index.css'



function ItemUser({name,email,address,}){






    return(
        <div id="user">
            <item id="label1">Name: {name}</item>
            <item id="label2">Email: {email}</item>
            <a id="label3">City: {address}</a>
        </div>
    )
}

export default ItemUser;
